-- ----------------------------
-- Table structure for sys_event
-- ----------------------------
DROP TABLE IF EXISTS `sys_event`;
CREATE TABLE `sys_event` (
  `event_id` int NOT NULL AUTO_INCREMENT,
  `host_id` int NOT NULL,
  `event_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `event_type` int NOT NULL DEFAULT '1',
  `image` mediumtext COLLATE utf8mb4_unicode_ci,
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'event description',
  `location` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'address of event',
  `site_description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'address additional info',
  `start_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `is_cancelled` tinyint NOT NULL DEFAULT '0' COMMENT 'whether event is cancelled or not',
  `is_displayed` tinyint NOT NULL DEFAULT '1' COMMENT 'online or offline',
  `star_level` float NOT NULL DEFAULT '3' COMMENT 'star level of events',
  `online` tinyint NOT NULL DEFAULT '0' COMMENT 'online or in-person',
  `event_tag` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'tag of event for recommendation',
  `create_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'log of manipulation',
  `update_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`event_id`),
  UNIQUE KEY `event_id_index` (`event_id`) USING BTREE,
  KEY `event_type_index` (`event_type`) USING BTREE,
  KEY `start_level_index` (`star_level`) USING BTREE,
  KEY `event_tag_index` (`event_tag`) USING BTREE,
  KEY `time_index` (`create_time`,`update_time`) USING BTREE,
  KEY `host_id_index` (`host_id`) USING BTREE,
