DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int NOT NULL AUTO_INCREMENT,
  `role_id` int DEFAULT NULL,
  `username` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `nickname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `avatar` mediumtext COLLATE utf8mb4_unicode_ci,
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `phone_number` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `pref_tag` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `balance` decimal(10,2) DEFAULT '100.00',
  `qualification` mediumtext COLLATE utf8mb4_unicode_ci,
  `is_auth` tinyint DEFAULT '0',
  `is_verified` tinyint DEFAULT '0',
  `is_received` tinyint NOT NULL DEFAULT '0',
  `bank_details` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `create_by` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `update_by` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_index` (`id`) USING BTREE,
  KEY `role_id_index` (`role_id`) USING BTREE,
  KEY `time_index` (`create_time`,`update_time`) USING BTREE,
  CONSTRAINT `sys_user_role_id_key` FOREIGN KEY (`role_id`) REFERENCES `sys_role` (`role_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

